import React from 'react'
import {Text,View, StyleSheet,Image} from 'react-native'

const TitleComponent = ({title}) => {
    return(
        <View>
            <Text> Dette er min prop title: {title}</Text>
        </View>
    );
}

TitleComponent.defaultProps ={
    title:'Hejsa'
}
